import React from 'react';
import {connect} from "react-redux";
import '../style/global.css';

const mapStateToProps = (state) => {
  return {
    appState: state.appState
  }
};

const AdminTools = (props) => {
  return(
    <div>
      <p>AdminTools</p>
    </div>
  );
};

export default connect(mapStateToProps)(AdminTools);
